import React from 'react'

class Task extends React.Component {

    render() {
        return (
            <div className="tasks">
                <div className="Task">
                    <div className="label">
                 - {this.props.category}
                        {this.props.text}
                    </div>
                <button>Delete This Task</button>
                </div>
            </div>
        )
    }
}

export default Task
